window.bookSummaryJSON = "<p>An ultimatum that will change her life forever. A whirlwind romance that continues to challenge her. A betrayal that could break her.</p> <p>As Calla’s relationship with the vampires who laid claim to her continues to grow, they are faced with their biggest obstacle yet—her mortality. And when vampires are outed on national television, putting all of their lives at risk, the lines between right and wrong become blurred as they must devise a plan to protect their own.</p> <p>Despite the looming danger, Calla can’t help falling deeper for the vampires who she’s come to learn have more to them than the blood oath that brought them to her. On the brink of war with both hunters and ancient vampires, they must pick a side—a decision that could ruin them all.</p> <p><i>Unraveled by Desire</i> is the fifth installment in the steamy and addictive Blood Oath series!</p>"; 
